  return (
    <li className={classes.Work}>
      <div className={classes.Label}>Dota 2</div>
      <div className={classes.Description}>
        <style>
          @import
          url('https://fonts.googleapis.com/css2?family=Langar&display=swap');
        </style>
        come in and play Dota, do not regret what you did
      </div>
      <div className={classes.BottomBlock}>
        <div className={classes.Users}>
          <i class="fa fa-users" aria-hidden="true">
            :5
          </i>
        </div>
        <div className={classes.Password}>zabastovka2002</div>
      </div>
    </li>
  );
};
export default WorkComponent;
